import React, { useState } from "react";

function Register() {
  const [ran, getVal] = useState("");
  const [isHover, setColor] = useState(false);
  const [name, changeHead] = useState("");
  function setHead(event) {
    changeHead(ran);
    event.preventDefault();
  }
  function changeVal(event) {
    getVal(event.target.value);
  }
  function changeBlack() {
    setColor(true);
  }
  function changeWhite() {
    setColor(false);
  }
  return (
    <div className="register-container">
      <h1>Hello {name}</h1>
      <form onSubmit={setHead}>
        <input
          type="text"
          placeholder="What's your name?"
          onChange={changeVal}
        />
        <button class="loginButton"
          onMouseOver={changeBlack}
          onMouseOut={changeWhite}
          style={{ backgroundColor: isHover ? "black" : " white" }}
        >
          Submit
        </button>
      </form>
    </div>
  );
}

export default Register;
